import React, { useState } from 'react';
import './styles.css';
import { Link } from 'react-router-dom';
import PlayStockfish from './PlayStockfish';


const StockfishGamePage = () => {

    return (
        <div className="landing-page">
            <header>
            <nav>
            <ul>
                        <li><Link to="/"><img height="35px" src="./squarelogo.png" style={{ verticalAlign: 'middle' }} alt="Home" /></Link></li>
                        <li className="features-dropdown">
                            <a href="#">Prepare</a>
                            <ul className="features-dropdown-menu">
                                <li><Link to="/play-stockfish">Play vs Stockfish</Link></li>
                            </ul>
                        </li>
                        <li><Link to="/analysis-board">Analysis Board</Link></li>
                        <li><a href="#import-games">Import Games</a></li>
                        <li><a href="#about-us">About Us</a></li>
                    </ul>
                </nav>
            </header>

            <main>
            <div><PlayStockfish/></div>
            </main>


            <footer>
                <p>&copy; SquareChess. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default StockfishGamePage;
